<body>
<script>
    var s = new HashMap();
    s.set('1','你好');
    s.set({},1);
    s.set(null,10);
    console.info(s);
    s.set({"haha":{"name":"travis"}},10);

    ss.push("s");
    ss.push(s);
    console.info(ss);

</script>
